import React, { useState } from 'react';
import {
  Container,
  Typography,
  Box,
  Card,
  CardContent,
  Chip,
  Divider,
  Button
} from '@mui/material';
import { Receipt, Visibility } from '@mui/icons-material';

const OrdersPage = () => {
  const [orders] = useState([
    {
      id: 'ORD-001',
      orderReference: 'BABA-2024-001',
      date: '2024-01-15',
      status: 'Delivered',
      totalAmount: 1748.00,
      deliveryFee: 50.00,
      items: [
        { name: 'Socket', quantity: 2, price: 299, totalPrice: 598 },
        { name: 'Switch', quantity: 1, price: 799, totalPrice: 799 },
        { name: 'LED Bulb', quantity: 3, price: 650, totalPrice: 1950 }
      ],
      deliveryAddress: {
        customerName: 'John Doe',
        street: '123 Main Street',
        city: 'Manila',
        postalCode: '1000'
      }
    },
    {
      id: 'ORD-002',
      orderReference: 'BABA-2024-002',
      date: '2024-01-20',
      status: 'Processing',
      totalAmount: 1200.00,
      deliveryFee: 50.00,
      items: [
        { name: 'Circuit Breaker 20A', quantity: 1, price: 1200, totalPrice: 1200 }
      ],
      deliveryAddress: {
        customerName: 'John Doe',
        street: '123 Main Street',
        city: 'Manila',
        postalCode: '1000'
      }
    }
  ]);

  const getStatusColor = (status) => {
    switch (status.toLowerCase()) {
      case 'delivered':
        return 'success';
      case 'processing':
        return 'warning';
      case 'shipped':
        return 'info';
      case 'cancelled':
        return 'error';
      default:
        return 'default';
    }
  };

  return (
    <Container maxWidth="md">
      <Typography variant="h4" gutterBottom sx={{ fontWeight: 'bold', mb: 3 }}>
        My Orders
      </Typography>

      {orders.length === 0 ? (
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            minHeight: 300,
            textAlign: 'center'
          }}
        >
          <Receipt sx={{ fontSize: 64, color: 'grey.400', mb: 2 }} />
          <Typography variant="h6" color="text.secondary" gutterBottom>
            No orders yet
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Your order history will appear here
          </Typography>
        </Box>
      ) : (
        <Box>
          {orders.map((order) => (
            <Card key={order.id} sx={{ mb: 3 }}>
              <CardContent sx={{ p: 3 }}>
                <Box display="flex" justifyContent="space-between" alignItems="flex-start" sx={{ mb: 2 }}>
                  <Box>
                    <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
                      Order #{order.orderReference}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Placed on {new Date(order.date).toLocaleDateString()}
                    </Typography>
                  </Box>
                  <Chip
                    label={order.status}
                    color={getStatusColor(order.status)}
                    variant="filled"
                  />
                </Box>

                <Divider sx={{ my: 2 }} />

                <Box sx={{ mb: 2 }}>
                  <Typography variant="subtitle2" gutterBottom sx={{ fontWeight: 'bold' }}>
                    Items ({order.items.length}):
                  </Typography>
                  {order.items.map((item, index) => (
                    <Box key={index} display="flex" justifyContent="space-between" sx={{ mb: 1 }}>
                      <Typography variant="body2">
                        {item.name} × {item.quantity}
                      </Typography>
                      <Typography variant="body2" sx={{ fontWeight: 'bold' }}>
                        ₱{item.totalPrice.toFixed(2)}
                      </Typography>
                    </Box>
                  ))}
                </Box>

                <Divider sx={{ my: 2 }} />

                <Box sx={{ mb: 2 }}>
                  <Typography variant="subtitle2" gutterBottom sx={{ fontWeight: 'bold' }}>
                    Delivery Address:
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    {order.deliveryAddress.customerName}<br />
                    {order.deliveryAddress.street}<br />
                    {order.deliveryAddress.city} {order.deliveryAddress.postalCode}
                  </Typography>
                </Box>

                <Divider sx={{ my: 2 }} />

                <Box display="flex" justifyContent="space-between" alignItems="center">
                  <Box>
                    <Typography variant="body2" color="text.secondary">
                      Subtotal: ₱{order.totalAmount.toFixed(2)}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Delivery Fee: ₱{order.deliveryFee.toFixed(2)}
                    </Typography>
                    <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
                      Total: ₱{(order.totalAmount + order.deliveryFee).toFixed(2)}
                    </Typography>
                  </Box>
                  <Button
                    variant="outlined"
                    startIcon={<Visibility />}
                    size="small"
                  >
                    View Details
                  </Button>
                </Box>
              </CardContent>
            </Card>
          ))}
        </Box>
      )}
    </Container>
  );
};

export default OrdersPage;
